import {Navigate, useLocation, useNavigate} from "react-router-dom";
import React, {useState} from "react";
import {Button, Divider, Grid, ListItemSecondaryAction, Typography} from "@mui/material";
import ListItem from "@mui/material/ListItem";
import ListItemButton from "@mui/material/ListItemButton";
import List from '@mui/material/List'
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

const VotationsAdministration = () => {
    const navigate = useNavigate();
    const [allVotationsList, setAllVotationsList] = useState<any[]>(['votazione1', 'votazione2', 'votazione3', 'votazione4', 'votazione5', 'votazione6', 'votazione7', 'votazione8','votazione9', 'votazione10', 'votazione11'])
    const [selectedVotation, setSelectedVotation]= useState(null)
    const location = useLocation()
    const isAdmin = location.state?.isAdmin
    const token = location.state?.token

    if (isAdmin === undefined || token === undefined || !isAdmin) {
        console.log('non sei loggato come admin')
        return <Navigate to='/'/>
    }

    const handleVotationsAdministrationFormOpen=(value:any)=>{
        setSelectedVotation(value)
    }

    const handleEnableDisable=()=>{
        console.log('abilito o disabilito')
        setSelectedVotation(null)
    }

    return (
        <>
            <Grid container spacing={2} justifyContent="center" alignItems="center">
                <Grid item xs={12} display="flex" justifyContent="center" alignItems="flex-start">
                    <Typography style={{color: 'white', textAlign: 'center', fontSize: '3rem'}}>Amministrazione iniziative</Typography>
                </Grid>
                <Grid item xs={12} display="flex" justifyContent="center" alignItems="center">
                    <List sx={{
                        width: '90%',
                        position: 'relative',
                        overflow: 'auto',
                        maxHeight: 500,
                    }}>
                        {allVotationsList.map((value, index) => {
                            return (
                                <>
                                    <ListItem key={index}>
                                        <ListItemButton onClick={() => handleVotationsAdministrationFormOpen(value)}>{value}</ListItemButton>
                                        <ListItemSecondaryAction> STATO ATTIVO/DISATTIVO</ListItemSecondaryAction>
                                    </ListItem>
                                    <Divider color='white'/>
                                </>
                            );
                        })}
                    </List>
                </Grid>
                {
                    selectedVotation?
                        <Dialog fullWidth={true} open={selectedVotation} onClose={()=>setSelectedVotation(null)}>
                            <DialogTitle>Subscribe</DialogTitle>
                            <DialogContent>
                                <DialogContentText>
                                    Abilita o disabilita una votazione
                                </DialogContentText>
                            </DialogContent>
                            <DialogActions>
                                <Button onClick={()=>handleEnableDisable()}>Abilita/Disabilita</Button>
                            </DialogActions>
                        </Dialog>: null
                }
            </Grid>
        </>
    );
}

export default VotationsAdministration
